
def react(s):
  temp_s = s
  prev_s = s
  done = False
  while not done:
    for c in "abcdefghijklmnopqrstuvwxyz":
      c_cap = c.upper()
      temp_s = temp_s.replace(c+c_cap,'').replace(c_cap+c,'')
    if (len(prev_s) == len(temp_s)):
      done = True
    else:
      prev_s = temp_s
        
  return(temp_s)

def canReact(s):
  return ( ((s[0:1].islower() and s[1:].isupper()) or
    (s[0:1].isupper() and s[1:].islower())) and
    (s[0:1].lower() == s[1:].lower()) )

print("running...")
orig_s = ""
min_len = len(orig_s)+1
for c in "abcdefghijklmnopqrstuvwxyz":
  s = orig_s
  s = s.replace(c,'').replace(c.upper(),'')
  new_s = react(s)
  if len(new_s) < min_len:
    min_len = len(new_s)

print("min length is: " + str(min_len))

print("done.")

 

    
